import React from "react";
import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'



const Cards = () => {
  return (
    <div className="card">
      <Card style={{ width: "18rem" }}>
        <Card.Img variant="top" src= {require('../assets/welcomepage.png')} />
        <Card.Body>
          <Card.Title>Bechdel Billboard</Card.Title>
          <Card.Text>
          The Bechdel Billboard is an app that allows the user to find a list of movies that pass the bechdel test and allow for our users to blog and comment on the stories that inspire them.
          </Card.Text>
          <Button href="https://bechdelbillboard.herokuapp.com/" variant="primary">App</Button>
          <Button href="https://github.com/Franciscorosado09/BechdelBillboard" variant="primary">Github</Button>
        </Card.Body>
      </Card>
    </div>
  );
};

export default Cards;
